import "./NavLink.scss";
import {NavLink} from "react-router-dom";

interface NavLinksProperties {
    navItems: any;
}

const NavLinks = (props: NavLinksProperties) => {
    const {navItems} = props;

    const individualNavItems = navItems.map((navItem: { link: string; label: string; }) => {
        return (
            <NavLink
                className="navigation-links"
                to={navItem.link}
                key={navItem.label}
            >
                {navItem.label}
            </NavLink>
        );
    });

    return (
        <div>
            {individualNavItems}
        </div>
    );
};

export default NavLinks;
